(function() {
	var imagesDb = {
		'sheep_head.png': 'data:image/png;base64,',
		'fb_share.png': 'data:image/png;base64,',
		'fb_white.png': 'data:image/png;base64,',
		'gplus_share.png': 'data:image/png;base64,',
		'gplus_white.png': 'data:image/png;base64,',
		'twitter_share.png': 'data:image/png;base64,',
		'twitter_white.png': 'data:image/png;base64,',
		'light_bulb.png': 'data:image/png;base64,'
	};
	
	var onReady = function(fn) {
		if(document.readyState !== 'loading') {
			window.setTimeout(fn);
			return;
		}
		var fired = false;
		var loaded = function() {
			if(!fired) {
				document.removeEventListener('DOMContentLoaded', loaded);
				window.removeEventListener('load', loaded);
				window.setTimeout(fn);
				fired = true;
			}
		};
		document.addEventListener('DOMContentLoaded', loaded);
		window.addEventListener('load', loaded);
	};
	onReady(function() {
		var raf = window.requestAnimationFrame || function(cb) {
			return setTimeout(cb);
		};
		var images = document.querySelectorAll('img[data-imgDb]');
		if(images && images.length) {
			var tasks = [];
			for(var i = 0; i < images.length; i++) {
				var img = images[i];
				var dbName = img.getAttribute('data-imgDb');
				if(dbName && imagesDb[dbName]) {
					tasks.push(img.setAttribute.bind(img, 'src', imagesDb[dbName]));
				}
			}
			var runTask = function(index) {
				if(index < tasks.length) {
					tasks[index]();
					raf(runTask.bind(window, index + 1));
				}
			};
			raf(runTask.bind(window, 0));
		}
	});
})();